import React from 'react';

const Header = () => (
  <header>
    <h1>Harsh Agrawal</h1>
    <p>Google Cloud Felicitator Participant | Full Stack Developer | Java Developer | Founder TechCross | Stock Analyst | BigShot Intern</p>
    <p>StockGro | National Chess Player | OP Jindal University, Raigarh, Chhattisgarh, India</p>
  </header>
);

export default Header;
